import { useState } from "react";
import { menuItems } from '../../internalApi/menuApi'
import MenuButtons from '../menuButton/MenuButton'
import './navBar.css'

export default function NavBar(props) {


    return (
        <>
            <div className={props.visibility}>
                <ul>
                    {
                    menuItems.map((a) => (
                        <li
                        className="items"
                        >
                            <a>
                                {a.item}
                            </a>
                        </li> 
                        ))
                    }
                </ul>
            </div>
        </>
    )
}
